(75, 'DCAC001', 'DC16KW', 'Smart Card', 'Public', 'The Aadhaar Smart Card is a physical card that contains an individual\'s Aadhaar details in a chip format. It serves as a convenient way to carry and present your Aadhaar information when required, without having to carry your original Aadhaar card. The card is available to anyone who has an Aadhaar number and can be ordered online through the UIDAI website or from authorized centers.', 150, '50', 0, NULL, 'Thumbnails/Services/Smart Card/SS_Smart Card_1683385058.jpg', 'No', '2023-06-03 05:16:47', '2022-08-11 18:18:55'),
(77, 'DCAC001', 'DC32MYA', 'Gender Corrrection', 'Public', 'Gender Declaration in Aadhar is very Curial Field, as it declares the identity of  an idividual', 250, '50', 0, NULL, 'Thumbnails/Services/Gender Corrrection/SS_Gender Corrrection_1701006720.png', 'No', '2023-06-03 05:16:48', '2023-06-02 04:49:32'),
